import PropTypes from 'prop-types';
import React from 'react';

import styles from 'styles/components/Input.module.css';

export default function Input({
  className,
  inputRef = null,
  icon: Icon,
  onIconClick = () => {},
  ...props
}) {
  return (
    <>
      <input className={`${styles.input} ${className}`} ref={inputRef} {...props} />
      {Icon && <div className={styles.input__icon} onClick={onIconClick}></div>}
    </>
  );
}

Input.propTypes = {
  className: PropTypes.any,
};
